'use strict';

function onFileParsed (input) {
    // const forPlayerId = "MasterProject.Chess.Agents.CCCP_Det";
    const forPlayerId = "MasterProject.GodfieldLight.Agents.RandomButAvoidDiscarding";
    // const binningLimit = 5000;
    // const binningLimit = undefined;
    // const binningFraction = 50;
    const binning = 40;
    console.log(input);
    input.matchupRecords.forEach(record => {
        if(record.gameResults.length > 0){
            if(record.playerIds[0] == forPlayerId){
                console.log(`against ${record.playerIds[1]}`);
                let csvRows = [];
                csvRows[0] = ["Matches", "Wins", "Losses", "Draws"];
                let counters = [0, 0, 0];
                record.gameResults.forEach((result, resultIndex) => {
                    const c = result.charAt(0);
                    if(c == "W"){
                        counters[0]++;
                    }else if(c == "L"){
                        counters[1]++;
                    }else if(c == "D"){
                        counters[2]++;
                    }else{
                        throw new Error("what?");
                    }
                    if((resultIndex + 1) % binning == 0){
                        const newRow = [];
                        newRow.push(resultIndex + 1);
                        counters.forEach((c, ci) => {
                            const percentage = ((100 * c) / (resultIndex + 1));
                            newRow.push(`${percentage.toFixed(2)}`);
                        });
                        csvRows.push(newRow);
                    }
                });
                let csv = "";
                csvRows.forEach(row => {
                    csv += row.join(", ");
                    csv += "\n";
                });
                console.log(csv);
            }
        }
    });
}

